        "id": "6008e4ca-057e-4bd9-8664-5b24c22e5ec9",
        "title": "JavaScript is Functions",
        "description": "<p>In every language, we need to validate data before modifying or displaying it.</p><p>So, here in the case of javascript also we almost regularly use these functions and we maintain all these in single util class to reuse quickly.</p><p>No further theory let’s jump into stuff.</p><p>Basically,</p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(0, 92, 197);\">1</span>;<span style=\"color: rgb(3, 47, 98);\">'number'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(0, 92, 197);\">1.2</span>;<span style=\"color: rgb(3, 47, 98);\">'number'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(227, 98, 9);\">NaN</span>;<span style=\"color: rgb(3, 47, 98);\">'number'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(0, 92, 197);\">false</span>;<span style=\"color: rgb(3, 47, 98);\">'boolean'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(3, 47, 98);\">''</span>;<span style=\"color: rgb(3, 47, 98);\">'string'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(215, 58, 73);\">function</span> () {};<span style=\"color: rgb(3, 47, 98);\">'function'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(0, 92, 197);\">undefined</span>;<span style=\"color: rgb(3, 47, 98);\">'undefined'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> <span style=\"color: rgb(0, 92, 197);\">null</span>;<span style=\"color: rgb(3, 47, 98);\">'object'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> {};<span style=\"color: rgb(3, 47, 98);\">'object'</span></p><p><span style=\"color: rgb(215, 58, 73);\">typeof</span> [];<span style=\"color: rgb(3, 47, 98);\">'object'</span></p>",
