        "description": "<p><strong style=\"color: rgb(36, 36, 36);\"><em>Splice</em>:</strong><span style=\"color: rgb(36, 36, 36);\">ইন্ডেস্ক নাম্বার দিয়ে কোনো আইটেম রিমুভ করতে we use Splice. এখানে ইনডেক্স নাম্বার কত থেকে শুরু করে কত পর্যন্ত রিমুভ করতে চাচ্ছেন সেগুলা আর্গুমেন্ট হিসেবে এখানে যাবে. Ex</span></p><p class=\"ql-indent-7\"><img src=\"data:image/png;base64,\"></p><p><span style=\"color: rgb(36, 36, 36);\">আপনি চাইলে রিমুভ করা ডাটাগুলোও আবার আরেকটা ভ্যারিয়েবলে স্টোর করে রাখতে পারবেন</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(36, 36, 36);\"><br></span><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><br></p>",
